"""
The document metadata dictionary should include the title, version, a brief
description, and a version history. The history is an array containing
3tuples of version number, date and change description. Example below:

METADATA = {
    'title': 'ACCESS Utilization',
    'version': 3,
    'description': 'This report describes utilization information for ACCESS-allocated compute resources.',
    'history': [
        [ '1', '2024-10-23', 'Initial Version.'],
        [ '2', '2025-01-15', 'Updated time range for plots.'],
        [ '3', '2025-04-03', 'Fix typographic errors, update plot times and resource specification for Stampede2.'],
    ]
}
"""
def footer(docmeta=None):

    footermd = ""
    if docmeta:
        footermd = """
# Document Version History
| Version | Date  | Notes |
| ------- | ----- | ----- |
"""
        
        for entry in docmeta['history']:
            footermd += "| " + " | ".join(entry) + " |\n"
        
    footermd += """

---
![XDMoD](data:image/png;base64,) XDMoD Data Analytics Framework {}
""".format(__version__)

    return Markdown(footermd)

